import React from 'react';
import './logoCarousel.css';

function LogoCarousel() {
  const logos = [
    { src: `${process.env.PUBLIC_URL}/images/telkomuniverseity.png`, alt: 'Telkom University' },
    { src: `${process.env.PUBLIC_URL}/images/ITB.jpg`, alt: 'ITB' },
    { src: `${process.env.PUBLIC_URL}/images/SMKTMKS.png`, alt: 'SMK TMKS' },
    { src: `${process.env.PUBLIC_URL}/images/SMK2MKS.jpg`, alt: 'SMK TMKS' },
    { src: `${process.env.PUBLIC_URL}/images/ui.png`, alt: 'UI' },
    { src: `${process.env.PUBLIC_URL}/images/unhas.jpg`, alt: 'UNHAS' },
  ];

  const logoItems = [...logos, ...logos];

  return (
    <div className="container pb-2rem bg-black-rich-fogra">
      <div className="row d-flex justify-content-center py-2-5-rem">
        <div className="col-12">
          <div className="logos d-flex overflow-x-hidden bg-transparent">
            <div className="logos-slider d-flex align-items-center">
              {logoItems.map((logo, index) => (
                <div key={index} className="mx-5 logo-item">
                  <img className="max-w-125 h-30" src={logo.src} alt={logo.alt} />
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default LogoCarousel;
